import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View } from 'react-native';
import LoginScreen from './src/containers/LoginScreen';
import HomeScreen from './src/containers/HomeScreen';
import RoommateViewPostScreen from './src/containers/RoommateViewPostScreen';
import RoomViewPostScreen from './src/containers/RoomViewPostScreen';
import FavouriteScreen from './src/containers/FavouriteScreen';
import ProfileScreen from './src/containers/ProfileScreen';
import Ionicons from 'react-native-vector-icons/Ionicons';



import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { createStackNavigator } from '@react-navigation/stack';

const Stack = createStackNavigator();
const Tab = createBottomTabNavigator();


function LoginStack() {
  return (
      <Stack.Navigator >
        <Stack.Screen  name="LoginScreen" component={LoginScreen}/>
      </Stack.Navigator>
    
  );
}

function HomeStack() {
  return (
      <Stack.Navigator >
        <Stack.Screen  name="HomeScreen" component={HomeScreen}/>
        <Stack.Screen  name="RoommateViewPostScreen" component={RoommateViewPostScreen}/>
        <Stack.Screen  name="RoomViewPostScreen" component={RoomViewPostScreen}/>
      </Stack.Navigator>
    
  );
}
function FavouriteStack() {
  return (
      <Stack.Navigator >
        <Stack.Screen  name="FavouriteScreen" component={FavouriteScreen}/>
      </Stack.Navigator>
    
  );
}
function ProfileStack() {
  return (
      <Stack.Navigator >
        <Stack.Screen  name="ProfileScreen" component={ProfileScreen}/>
      </Stack.Navigator>
    
  );
}

export default function App() {
  return (
    <NavigationContainer>
      <Tab.Navigator
        screenOptions={({ route }) => ({ 
          headerShown: false,
          tabBarIcon: ({ focused, color, size }) => {

            let iconName;

            if (route.name === 'Home') {
              iconName = "home"
            } else if (route.name === 'Favourite') {
              iconName = "star"
            } else if (route.name === 'Profile') {
              iconName = "person"
            }
            

            
            // You can return any component that you like here!
            return <Ionicons name={iconName} size={size} color={color} />;
                    
          },
          tabBarActiveTintColor: '#6E4119',
          tabBarInactiveTintColor: 'black',
          tabBarInactiveBackgroundColor: '#FFEDDD',
          tabBarActiveBackgroundColor: '#FFEDDD',
          
        })}
      >
        <Tab.Screen name="Home" component={HomeStack} options={{headerShown: false}}/>
        <Tab.Screen name="Favourite" component={FavouriteStack} />
        <Tab.Screen name="Profile" component={ProfileStack} />
      </Tab.Navigator>
    </NavigationContainer>
  );
}
